import React from 'react';
import {StyleLoginButton} from './StyleLogin'
import Button from '@material-ui/core/Button';

const LoginIndex = () => {
    
    return (
        <StyleLoginButton>
            <Button className="btn-login">Sign in</Button>
            <Button></Button>
        </StyleLoginButton>
    );
}

export default LoginIndex;
